import base64
import re
from random import randint

def md5(input_text):
    import hashlib
    """Получает MD5 хэш."""
    return hashlib.md5(input_text.encode("UTF-8")).hexdigest()


def myhash(s):
    return md5(md5(s) + "SECRET_SALT")

